import React from 'react'
import { Redirect, withRouter } from 'react-router-dom'

function Moving({redirect, setRedirect}) {


    function handleClick(e) {
        setRedirect('/'.concat(e.target.innerHTML.toLowerCase()))
    }

    if(redirect) {
        const path = redirect;
        return(
            <Redirect to={path}/>
        )
    }

    return(
        <div>
            <button onClick={handleClick}>Admin</button>
            <button onClick={handleClick}>Dashboard</button>
            <button onClick={handleClick}>Inventory</button>
        </div>
    )



}

export default withRouter(Moving)
